function _moldcell_stock_avail(avg, step, display) {
  if (display == 'default') {
    switch (step) {
      case 1:
        return avg>=1;
      case 2:
        return avg>=3;
      case 3:
        return avg>=5;
      case 4:
        return avg>=7;
      case 5:
        return avg>=10;
      default:
        return false;
    }
  }
  else {
    switch (step) {
      case 1:
        return avg>=1;
      case 2:
        return avg>=6;
      case 3:
        return avg>=11;
      case 4:
        return avg>=21;
      case 5:
        return avg>=30;
      default:
        return false;
    }
  }
}

